pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "./LegalEntityInfo.sol";

contract BNDESRegistryUpgrade is Ownable() {

    LegalEntityInfo private legalEntityInfoProxy;

    //Links Legal Entity to Ethereum address.  
    //cnpj => (idFinancialSupportAgreement => address)
//    mapping(uint64 => mapping(uint64 => address)) cnpjFSAddr; 


    event evn (address addr, uint cnpj);

    constructor (address storageContractAddr) public {
        legalEntityInfoProxy = new LegalEntityInfo(storageContractAddr);
    }

    function getLegalEntity (address addr) internal returns (LegalEntityInfo) {
        legalEntityInfoProxy.setAddrLegalEntity(addr);
        return legalEntityInfoProxy;
    }


    function registryLegalEntity(uint64 cnpj, address addr) public { 
        getLegalEntity(addr).setCNPJ(cnpj);
        emit evn(addr, cnpj);  
    }

    function getCNPJ(address addr) public returns (uint) {
        uint cnpj = getLegalEntity(addr).getCNPJ();
        emit evn(addr, cnpj);
        return cnpj;
    }

}
